import React from 'react';
import './Menu.css';

const ButtonGroup = () => {
  return (
    <div className="menu-container">
      <Link to="/register" className="button register">Register</Link>
      <button className="menu-button">Button</button>
      <button className="menu-button">Button</button>
      <button className="menu-button">Button</button>
      <button className="menu-button">Button</button>
    </div>
  );
};

export default ButtonGroup;
